(57807, 1, 3863, 2, '新年(Cheers)', '', '2012-12-21 00:00:00', 2000, 0, 1, 7, '我們都曾許下心願\n在跨越新年的時候\n要用心生活\n很快地又過了一年\n開始檢視著自我\n是否更成熟\n有沒有過得快樂身體健康更接近夢想\n心不再寂寞\n心不再寂寞\n就讓我們許下心願\n隨著燦爛的煙火\n施放到天空\n\n倒數計算的時間\n有怎樣的畫面\n興奮的一秒鐘\n將未來寄托\n\n阿 就閉上眼睛\n阿 無須說明\n就誠心地祈禱實現自己生命的節奏\n活出在你心底嚮往的面容\n將你珍惜的摯愛\n緊握\n\n很快地又過了一年\n開始檢視著自我\n是否更穩重\n有沒有撫平傷痕幸福平安也不再迷惘\n勇敢地走過\n所有的煩憂\n日曆它翻了翻頁\n又來到了起點\n迎接這你和我\n全新的年頭\n\n阿 就閉上眼睛\n阿 無須說明\n就誠心地祈禱實現自己生命的節奏\n活出在你心底嚮往的面容\n將你珍惜的摯愛\n\n走吧\n向希望前進\n走吧\n一同飛行\n就誠心地祈禱實現自己浪漫的念頭\n徜徉在你心中嚮往的宇宙\n將你珍惜的摯愛\n緊握', '', 244, '', '', '', '', '', '', 1, 1, 0, '2012-12-21 05:16:46', '2015-03-12 13:57:51', '0000-00-00 00:00:00'),
