(57817, 121143, 5418, 1, 'WHO U R', '我們都一直活在控制與被控制的領域裡,然而卻掩蓋不了想表達真實自己的慾望.其實你就是你,不必活在那個世界裡.you are who you are!\r\n', '2012-12-25 00:00:00', 2000, 25, 0, 7, '你無法控制我的窺探成癮 偷看你   失落而狂語 你無法控制別人竊竊私語 暗地裡   沒良心譴責你 你故意變換頻道 耐心準備發牢騷 很想生氣\r\n coz I know who you are  coz I know who you are  coz I know who you are  coz I know who you are  coz I know who you are  coz I know who you are \r\n 你無法控制我對你的期許 等人性   憤的揚起 你無法控制那些閒人勿進 偽善是   黑暗的蜜月期 你不想變換頻道 耐心不斷發牢騷 你很生氣\r\n coz I know who you are  coz I know who you are  coz I know who you are  coz I know who you are  coz I know who you are  coz I know who you are \r\n 壓抑狂躁不是你的本性 一味順從不是你的命運 沒必要吞下如果是委曲 沒必要奉承無條件拍馬屁 你會訝異你銅臭的身體 為真我而乾淨\r\n coz I know who you are  coz I know who you are  coz I know who you are  coz I know who you are  coz I know who you are  coz I know who you are  ', '', 253, '', '戴佩妮 ', '戴佩妮 ', '', '', '', 1, 1, 0, '2012-12-21 10:37:27', '2015-03-12 13:57:51', '0000-00-00 00:00:00'),
(57818, 121143, 5418, 2, '肺魚', '我們都試著不愛惜自己,試著忘了生存的意義,讓身體就像一條瀕臨乾枯而逝的魚,但卻還能用肺呼吸,還能被那突來的雨救起,如此的幸運…如此勇敢的走下去.\r\n', '2012-12-25 00:00:00', 2000, 25, 0, 7, '我們都任性    故意不被誰看穿    成了四肢痲痹 沒了意義    辜負了聰明 枉費了上天注定 我們都生病    讓久病放著不醫    養成一種宿命 焦灼的心已不再透明 滿垢的雲    傾成了雨    淋濕了乾枯的魚 (加速了我想痊愈)  \r\n 為親愛的美滿解一身難堪 為親愛的寒冷借一點溫暖 我拼命的游   游一個出口 值得絢爛就別袖手旁觀\r\n 對親愛的殘忍說一聲晚安 對親愛的傷口借一點勇敢 我拼命的游   反方向的游  若不盲從早一點背叛    不慌亂      不慌亂        不慌亂\r\n 祝我們不會再難堪 祝我們從此就溫暖 不必說晚安 祝我們變得更加勇敢\r\n 從此以後不再難堪 從此以後我們就溫暖  不必說晚安 現在的我們都很勇敢 ', '', 314, '', '戴佩妮 ', '戴佩妮 ', '', '', '', 1, 1, 0, '2012-12-21 10:39:00', '2015-03-12 13:57:52', '0000-00-00 00:00:00'),
