(57836, 166176, 5426, 6, 'Christmas Day', '', '2012-12-23 00:00:00', 2000, 0, 1, 7, 'Christmas Day\r\n\r\nLyrics: Ushou  / Song: Ushou\r\n\r\n\r\nThis is the end of the holiday \r\nWe walk into the subway\r\nnothing will changed between our way \r\nbut we couldn''t know what the fxxx is going on \r\n\r\nAll the things happened in crazy way \r\nstop talking about our \r\nI want to enjoy this easy break\r\njust give me a break  \r\n\r\nChorus\r\n\r\na ha a ha a a \r\nit''s Christmas Day \r\nIt''s lonely Day\r\n\r\na ha a ha a a \r\nit''s Christmas Day \r\nIt''s lonely Day\r\n\r\nVerse\r\n\r\nTalking our future is such a fake \r\nnot important that way \r\ncould stand any possiblity \r\n\r\nno wonder i fall into this valley\r\ntring to escape \r\nbut i can''t make it \r\n\r\nChorus\r\n\r\na ha a ha a a \r\nit''s Christmas Day \r\nIt''s lonely Day\r\n\r\na ha a ha a a \r\nit''s Christmas Day \r\nIt''s lonely Day\r\n', '', 204, '', 'Ushou', 'Ushou', 'Ushou', 'Ushou Studio', '', 0, 1, 0, '2012-12-21 16:47:13', '2015-03-12 13:57:52', '0000-00-00 00:00:00'),
(57837, 66227, 0, 1, '一直都是這樣', '總是會在忙碌的時候、夜闌人靜的時候，\r\n想起年少時的瘋狂和勇氣。\r\n\r\n豪情萬丈的我們，曾經聚集在一樣的地方，\r\n做著一個個偉大的夢。\r\n\r\n但曾幾何時，我們乘上時間的洪流，\r\n那湍急的光陰，沖散我們，沖垮我們的夢。\r\n\r\n其實有時候我也分不清楚，\r\n我究竟是想念那些奔放的夢想，\r\n還是想念曾經那樣勇敢的你我。\r\n\r\n謹以此首歌，獻給我最愛的附中，\r\n和當年跟我一起做夢的朋友們。\r\n\r\n我會永遠記得，那個在樂教館一起喝啤酒的夜晚。', '2012-12-21 00:00:00', 2012, 0, 1, 7, '一直都是這樣　我們倚在五樓的圍牆\r\n丟下寶特瓶的包裝　隨風遊蕩\r\n地上的磁磚顏色不一樣\r\n哪裡是它的家\r\n我們嘻笑凝望　賭一碗豆花\r\n\r\n一直都是這樣　我們坐在無人的操場\r\n拉開啤酒的拉環　苦澀分享\r\n手上的空罐形狀都一樣\r\n裝不同的夢想\r\n我們舉杯猖狂　賭一生牽掛\r\n\r\n離開　我們終究會攜手分開\r\n誰來　遠遠地填滿\r\n愈長愈大　真心就愈來愈淡\r\n就像漣漪　愈來愈遠愈廣泛\r\n\r\n一直都是這樣　我們走在忙碌的街上\r\n完成行程上的規劃　不容想像\r\n天空的雲朵是否不一樣\r\n多久沒有仰望\r\n我們匆匆品嚐　輸一生時光\r\n\r\n一直都是這樣　我們醒在獨自的凌晨\r\n關上孤傲的燈光　留一盞窗\r\n回憶的內容多久都一樣\r\n頂多有點泛黃\r\n我們忘了怎樣　輸一碗豆花\r\n\r\n離開　我們不會再攜手回來\r\n誰來　偶爾地作伴\r\n愈長愈大　獨立就愈來愈難\r\n就像年輪　愈來愈密愈飽滿\r\n\r\n離開　我們不是都夢想未來\r\n誰來　解釋這慌亂\r\n愈長愈大　相聚就愈來愈難\r\n像蒲公英　愈飄愈遠　然後花開', '', 287, '', '張之謙', '張之謙', '張之謙', '', '', 0, 0, 1, '2012-12-21 17:03:05', '2013-11-27 17:56:25', '2013-11-27 17:56:25'),
(57838, 5519, 0, 1, '末日青春 (demo)', '不管末日 只想盡情揮灑或許能屬於自己的那一片天 \n只要心臟還是跳躍的 就試試看 一步一步為自己的人生增添色彩吧\n', '2012-12-21 00:00:00', 2012, 0, 1, 4, '腳趾頭跟著清新的旋律跳動 眼角看著舖克牌旋轉飄落\n這是個沒有煩惱的歡樂時空 儘管放肆嬉鬧的享受其中\n\n一轉眼就來到這末日的年頭 誰又知道這是否只是個傳說\n回想起那小時候的矇懞懂懂 天真的落入快速的時光轉動\n\n與其擔憂害怕那些未知總總 不如就拋開煩憂\n試著回到最初的不顧一切直衝 讓生命更繽紛快活\n\n讓我們站在雲上 夢想飛揚\n讓心情不再拘束在一個地方\n抬頭望 望天上 你會看見世界是如此的美妙\n\n就算是跌跌撞撞 末日來到\n只要回歸那青春的無邪面貌\n抬頭望 望遠方 盡情揮灑屬於自己獨特的光\n', '', 232, '', 'dodow', 'dodow', 'dodow', '', '', 0, 0, 0, '2012-12-21 17:55:16', '2015-03-12 13:57:52', '0000-00-00 00:00:00'),
(57839, 123859, 5423, 1, '從五樓到五樓的派對', '我從我家五樓下樓\r\n沿著長長的馬路 \r\n再上你家五樓\r\n與你相會 與你派對', '2012-12-22 00:00:00', 2012, 0, 1, 7, '01 去一個地方成為新的自己\r\n我在哭 我在笑 眼盯著一個方框\r\n你以為自己過著怎樣的生活\r\n我打滾 我抖腳 手叼著一跟煙\r\n你以為自己過著怎樣的生活\r\n從窗戶吹來全世界的風 \r\n我想要赤腳到外面走一走\r\n走著走著就一去不回頭\r\n就去一個地方 \r\n成為新的自己\r\n最後 我恨我也愛我\r\n\r\n02 我有笑話不能與誰分享\r\n是不是我的眼中有淚水\r\n這黃昏畫面看起來憂憂傷傷\r\n斷斷續續看部電影\r\n路上景色走走停停\r\n在路上我撿到一個笑話\r\n在路上我撿到二個笑話\r\n在路上我撿到三個笑話\r\n在路上我撿到四個笑話\r\n然後把雙手放口袋 是不是就不用與誰分享\r\n然後把雙手放口袋  看起來一個人也很好\r\n\r\n03 Jane之歌\r\n蟲子的一天 失去的語言\r\n時間在背上手心蠕動著\r\n我們都知道這下午最難熬\r\n我們都知道卻不跟彼此講\r\n但是我有話想說\r\n\r\n', '', 579, '', '州大派隊', '周大派', 'Hyphen Lu', '', '', 1, 1, 0, '2012-12-22 00:42:34', '2015-03-12 13:57:52', '0000-00-00 00:00:00'),
