(57884, 128846, 0, 1, '廣播版你的形影', '', '2012-12-23 00:00:00', 2000, 0, 1, 7, '', '你的形影     詞曲:鄒勝閎 編曲:放志樂團\n\n為愛付出這多  最後得到是啥會\n愛若山盟海誓  愛和恨就未參作伙\n我有認真想過  面對你無情的反背\n情份攏咖伊放風吹 將你放在心肝底\n\n你所留下的這張信 甘是愛你的代價\n你說咱兩個  相欠債\n\n是你的形影 伴我的心聲 昨夜的夢\n是我的生活 攏哩的形影 過去的夢\n是你的形影 伴我的生活 做一個夢\n是你的形影 阿  刺心肝\n\n想你的形影 傷心的我 破碎的夢\n是我的生活 都哩的形影 未醒的夢\n想你的形影 伴我的生活 過一個人\n想你的形影  是你的形影   刺心肝\n\n\n\n.', 415, '', '', '', '', '', '', 0, 0, 0, '2012-12-23 02:43:22', '2015-03-12 13:57:53', '0000-00-00 00:00:00'),
