(57886, 121519, 0, 1, '老家(Demo)', '', '2012-12-24 00:00:00', 2012, 0, 1, 4, '我的二十歲是盛夏的綠\n陽光和煦 偶有陣雨 \n偶爾沖刷起過往的氣息\n是否成年後更容易追憶過去\n\n白日漫長 我常靜坐懷想\n想像鳥兒一樣 自由飛翔\n白日漫長 我常靜坐懷想\n想像海豚一樣 不怕大浪\n\n老家 回老家 \n趁著還有時間 快回到那長大的地方\n回那高低不齊的矮房\n記憶裡永不枯萎的鳳仙花 回去吧\n\n我的二十歲是盛夏的綠\n陽光和煦 偶有陣雨 \n偶爾沖刷起過往的氣息\n是否成年後更容易追憶過去\n\n白日漫長 我常靜坐懷想\n想像大樹一樣 堅毅不拔\n白日漫長 我常靜坐懷想\n想像兒時一樣 不怕長大 \n\n老家 回老家 \n趁著還有時間 快回到那長大的地方\n回那高低不齊的矮房\n記憶裡永不枯萎的鳳仙花 回去吧', '', 251, '', '劉俊成', '鄭宜雯', '阿克樂團', '', '', 0, 1, 0, '2012-12-24 01:05:03', '2015-03-12 13:57:53', '0000-00-00 00:00:00'),
(57887, 38006, 5427, 1, '石頭', '生命樹樂團 Tree Of Life - 石頭 Stone [樂團正式版]\r\n\r\n夢想是飛行，註定是墜落。\r\n\r\n我們在成長的路上從隨風飛揚的沙粒，\r\n漸漸地成長成了只能滾動的沈重石頭。\r\n就算，\r\n我的終點不是最高的山峰，\r\n至少我努力過這樣就足夠。\r\n\r\n-------------------------------------------------------------------\r\n生命樹樂團最新單曲『石頭』免費下載：\r\n\r\n什麼才是世界上最好的禮物呢？\r\n我想...是人與人之間「心」\r\n\r\n所以我們用心，用生命，\r\n寫成歌，譜成曲，\r\n將它作為禮物送給你。\r\n\r\n\r\n2012年用音樂當作我們這一生的交換禮物，\r\n邀你一起繼續努力執著。\r\n\r\n更多生命樹消息：\r\n生命樹Facebook:\r\nhttp://www.facebook.com/treeoflifeband\r\n\r\n生命樹Twitter:\r\n@TOLTaiwan', '2012-12-24 00:00:00', 2012, 0, 1, 4, '【石頭】\r\n蝸牛 靜靜的等候 風 輕輕的溫柔\r\n雲朵填補天空一片片的寂寞\r\n石頭 慢慢的滾動 有 很遙遠的夢\r\n萬年以後世界都會為他歌頌\r\n\r\n一生的自由 當作你的雙手\r\n寫下一個傳說\r\n\r\n原來我只是個微不足道的石頭\r\n註定一生只能不停向下墜落\r\n就算我的終點不是最高的山峰\r\n至少我努力過這樣就足夠\r\n\r\n當我 還在小時候 擁 有好多的夢\r\n乘著風就能夠盡情遨遊地球\r\n而我 長大了以後 頭 越來越沈重\r\n再大的風也帶不走我的苦衷\r\n\r\n一生的自由 當作你的雙手\r\n寫下一個傳說\r\n\r\n原來我只是個微不足道的石頭\r\n註定一生只能不停向下墜落\r\n就算我的終點不是最高的山峰\r\n至少我努力過這樣就足夠\r\n\r\n原來我只是個微不足道的石頭\r\n註定一生只能不停向下墜落\r\n就算我的終點不是最高的山峰\r\n至少我努力過這樣就\r\n\r\n原來我只是個微不足道的石頭\r\n註定一生只能不停向下墜落\r\n就算我的終點不是最高的山峰\r\n至少我努力過這樣就足夠\r\n\r\n就讓溫柔的風帶走我的夢', '', 280, '', '小王子', '小王子', '生命樹', '生命樹 / 植光土壤音樂工作室', '', 1, 0, 0, '2012-12-24 04:29:13', '2015-03-12 13:57:54', '0000-00-00 00:00:00'),
(57888, 72723, 0, 0, '1月26號練-唱原key-Tall, dark handsome Stranger', '', '2012-12-24 00:00:00', 2000, 0, 1, 7, 'Bbm        Bbm7   \nI''m so tired of these men trying to\n\n                        Eb Db Cm Bbm\nimpress me with nothing\n\n      Bbm7\nThe same old routine and the smooth\n\n             Eb Db Cm Bbm\nfancy talking\n\n         Eb\nNow I know and believe that I found\nit for real\n''Cos you''re good and you''re kind and\n\n    F\nyou care how I feel\n\n       Bbm7\nI had a tall dark handsome stranger\nI''ve had the devil in disguise\n\n            Eb7\nI''ve been attracted to the danger\n\n          Bbm7\nBut I was never satisfied\n\n          Eb\nAnd I know what I like\n\n                                   F\nAnd I like what I see in your eyes\n\nBbm7                Eb Db Cm Bbm\nYou''re so beautiful\n\nI''ve been pushed I''ve been pulled\nI''ve been put out and trod on\nJust by taking my chances I finally\ncaught on\nWhen I see in your eyes all the love\nshining through\nI''m so glad I held out for somebody\nlike you\n\nI had a tall dark handsome stranger\nI''ve had the devil in disguise\nI''ve been attracted to the danger\nBut I was never satisfied\nAnd I know what I like\nAnd I like what I see in your eyes\n\nGb\nHeaven must have sent you I know\n\n          Bbm\nYou''re so good to me\nI feel good with you\n\n    Gb\nI''d be such a fool to let you go\n\n         F\nThere''s something about you\n\n                        Bbm7\nI can''t live without you\n\nI''ve had fast talking good looking men\nat my door\nNow I''m a wiser woman than I was before\n\nI had a tall dark handsome stranger\nI''ve had the devil in disguise\n\n            Eb7\nI''ve been attracted to the danger\n\n          Bbm7\nBut I was never satisfied\n\n          Eb\nAnd I know what I like\n\n                                   F\nAnd I like what I see in your eyes\n\nI had a tall dark handsome stranger\nI''ve had the devil in disguise\nI''ve been attracted to the danger\nBut I was never satisfied\nAnd I know what I like\nAnd I like what I see in your eyes', '', 245, '', '', '', '', '', '', 0, 1, 1, '2012-12-24 12:49:03', '2014-09-20 01:55:34', '2014-09-20 01:55:34'),
(57889, 72723, 0, 0, '愛情陷阱-譚詠麟2010年演唱會版', '', '2012-12-24 00:00:00', 2000, 0, 1, 7, '歌詞:\r\n撥著大霧默默地在覓我的去路\r\n但願路上幸運遇著是妳的腳步\r\n我要再見妳\r\n祇想將心聲透露　愛慕\r\n\r\n獨自望著路上密密畫滿的記號\r\n像是混亂又像特別為了指我路\r\n到處去碰　到處去看\r\n墮入陷阱　方知太胡塗\r\n\r\n真心被俘虜　彷彿遭圈套\r\n探索這愛路\r\n妳那美態已叫我醉倒\r\n\r\n我墮入情網　妳卻在網外看\r\n始終不釋放\r\n妳笑笑看看我　像是望著獵物\r\n我心已傷\r\n\r\n我墮入情網　妳卻在網外看\r\n始終不釋放\r\n恨　愛　心中激盪\r\n這陷阱　這陷阱　這陷阱\r\n偏我遇上', '', 155, '', '', '', '', '', '', 0, 0, 1, '2012-12-24 12:49:42', '2014-09-20 01:55:45', '2014-09-20 01:55:45'),
(57890, 72723, 0, 0, '1月26號練-唱原key-請假-鍵盤吉他編曲用檔案', '', '2012-12-24 00:00:00', 2000, 0, 1, 7, '<請假> \r\n詞：方晴君2011年8月29日\r\n曲：黃銀山2011年9月15日\r\nA\r\n電話一通LING LING 的響起\r\n老師來電說小孩好像生病　\r\n我請假要帶他看醫生去\r\n卻聽到老闆嘀嘀咕咕　不高興\r\nB\r\n誰家小孩不用下課接送　\r\n不會偶爾有個病痛？\r\n不會有時真的找不到人帶？\r\n　我想老闆 你也~不例外　\r\nC\r\n老闆他說：請假為了小孩不如不要上班\r\n我不想為了那幾百塊加到天昏地暗\r\n安親班老師的臉色我不想看\r\n你想荷包滿滿　我不想賠掉生活的溫暖', '', 147, '', '', '', '', '', '', 0, 0, 1, '2012-12-24 12:50:15', '2014-09-20 01:55:45', '2014-09-20 01:55:45'),
